import React from 'react'

const Player = () => {
  return (
    <div>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/videoseries?si=uA3413ghvKnQvGa9&amp;list=PL0b6OzIxLPbxStBQ21C2toa5uQMqHEoRT" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
    </div>
  )
}

export default Player
